import React from "react";
import SingleResult from "./SingleResult";
import "./SingleResult.css";

function ShowResult(props) {
  const { items } = props;

  return (
    <div className="showResult">
      {items
        .filter((item) => {
          if (item.option === "Done" && props.selectedOptions.includes("Done")) {
            return true;
          } else if (item.option === "In Progress" && props.selectedOptions.includes("In Progress")) {
            return true;
          } else if (item.option === "Panding" && props.selectedOptions.includes("Panding")) {
            return true;
          }
          return false;
        })
        .map((item) => (
          <SingleResult key={item.value} item={item.value} option={item.option} />
        ))}
    </div>
  );
}

export default ShowResult;
